import React from "react"

const Interests = () => {
  const interests = ["ccok", "koko", "koaksodjidj"]
  return (
    <View style={styles.container}>
      <Text style={styles.title}>Skills</Text>
      <List>
        {interests.map((inter, i) => (
          <Item key={i}>{inter}</Item>
        ))}
      </List>
    </View>
  )
}

export default Interests
